import React from "react";
import Product from "./Product";

const Products = props => {
  return (
    <div className="product list">
      <ul>
        {props.products.map(prod => {
          <img src={prod.img} />;
          return <Product prod={prod} />;
        })}
      </ul>
    </div>
  );
};

export default Products;
